values:
I just got a nudge from a friend today and I realized I haven't updated my Live Journal in about 5 weeks.&nbsp; *lol*&nbsp; 
I've been doing well.&nbsp; I am working at the Olmsted Center for Blind as the receptionist/switchboard operator.&nbsp; I'm going to be there for at least two months.&nbsp; I love it because I can now afford to do things I couldn't.&nbsp; 
I'm busy on other web services like Twitter, Friendfeed and Facebook.&nbsp; That's why I haven't updated this thing.&nbsp; If you want to get my Twitter, FF and/or Facebook info leave a comment and I'll post it.&nbsp;
